import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>
          This is a React app!
        </h1>
      </header>
    </div>
  );
}

export default App;
